import React, { Component } from "react";
import PropTypes from "prop-types";

class Job extends Component {
  state = {
    job: [
      {
        title: "Frontend Developer",
        company: "Best Comapny",
        location: {
          city: "Kuala Lumpur",
          country: "Malaysia"
        },
        salary: 5000
      },
      {
        title: "Backend Developer",
        company: "Second Best Comapny",
        location: {
          city: "Melaka",
          country: "Malaysia"
        },
        salary: 4500
      },
      {
        title: "DevOps Engineer",
        company: "Third Best Comapny",
        location: {
          city: "Petaling Jaya",
          country: "Malaysia"
        },
        salary: 5000
      }
    ]
  };
  render() {
    const job = this.state.job.map(job => {
      return (
        <div className="container card">
          <div className="card-header text-primary">{job.title}</div>
          <div className="card-body">
            {job.company}
            {"  "}
            {job.location}
            <br />
            "salary: RM" {job.salary}
          </div>
        </div>
      );
    });

    return { job };
  }
}

Job.propTypes = {};

export default Job;
